　[清涼飲料水]<br>
Healthy Soft Drink<br><br>

BlueBerry40<br>
ブルーベリーエキス40mg<br>
100mL×10本入<hr>

【名称】清涼飲料水<br><br>

【原材料名】果糖ブドウ糖液糖、ブルーベリーエキス、L-カルニチン、甘味料(D-ソルビトール)、香料、酸味料、アントシアニン色素、カラメル色素、保存料(安息香酸Na)、ビタミンB6、ナイアシン、ビタミンB2<br><br>

【内容量】(100mLx10本入り)×5箱<br><br>

【賞味期限】パッケージ側面に記載<br><br>

【保存方法】高温・多湿及び直射日光をさけて保存してください。<br><br>

【栄養成分表示】100mL当たり<br>
エネルギー――67kcal<br>
ナトリウム――6mg<br>
タンパク質――Og<br>
ビタミンB2――2mg<br>
脂　　　質――Og<br>
ビタミンB6――10mg<br>
炭水化物――16.7g<br>
ナイアシン――10mg<br><br>

【注意】<br>
・天然成分配合ですので、まれに色の違いや沈澱が生じることがありますが、品質には影響ありません。<br>
・よく振ってからお飲みください。<br><br>

【販売者】<br>
株式会社富士薬品FP<br>
埼玉県さいたま市大宮区桜木町4丁目383番地<hr>
区分：飲料

<hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
